			shellPath = /bin/sh;
			shellScript = "set -e\n# Sets the target folders and the final framework product.\n# 如果工程名称和Framework的Target名称不一样的话，要自定义FMKNAME\n# 例如: FMK_NAME=\"MyFramework\"\n#FMK_NAME=\"IDMPCMCC\"\nFMK_NAME=${PROJECT_NAME}\n# Install dir will be the final output to the framework.\n# The following line create it in the root folder of the current project.\n# 获取当前时间\nDATE=$(date +%Y%m%d-%H:%M:%S)\n# 定义IDMPCMCC+当前时间 命名的文件夹名字\nINSTALL_DIR=${HOME}/Desktop/IDMPCMCC${DATE}\n# 支持真机静态库所在的路径\nDEVICE_DIR=${BUILD_DIR}/Release-iphoneos/\n# 支持模拟器静态库所在的路径\nSIMULATOR_DIR=${BUILD_DIR}/Release-iphonesimulator/\n# -configuration ${CONFIGURATION}\n# Clean and Building both architectures.\n# 配置生成静态库一些参数\nxcodebuild build BITCODE_GENERATION_MODE=bitcode OTHER_CFLAGS=\"-fembed-bitcode\" -configuration \"Release\" -target \"${FMK_NAME}\" -sdk iphoneos clean build ONLY_ACTIVE_ARCH=NO BUILD_DIR=\"${BUILD_DIR}\" OBJROOT=\"${OBJROOT}\" BUILD_ROOT=\"${BUILD_ROOT}\" SYMROOT=\"${SYMROOT}\" $ACTION\nxcodebuild build BITCODE_GENERATION_MODE=bitcode OTHER_CFLAGS=\"-fembed-bitcode\"  -configuration \"Release\" -target \"${FMK_NAME}\" -sdk iphonesimulator clean build ONLY_ACTIVE_ARCH=NO BUILD_DIR=\"${BUILD_DIR}\" OBJROOT=\"${OBJROOT}\" BUILD_ROOT=\"${BUILD_ROOT}\" SYMROOT=\"${SYMROOT}\" $ACTION\n# Cleaning the oldest.\nif [ -d \"${INSTALL_DIR}\" ]\nthen\nrm -rf \"${INSTALL_DIR}\"\nfi\nmkdir -p \"${INSTALL_DIR}\"\ncp -R \"${DEVICE_DIR}/\" \"${INSTALL_DIR}/\"\n# Uses the Lipo Tool to merge both binary files (i386 + armv6/armv7) into one Universal final product.\n# 合并真机和模拟器架构静态库\nlipo -create \"${DEVICE_DIR}/lib${FMK_NAME}.a\" \"${SIMULATOR_DIR}/lib${FMK_NAME}.a\" -output \"${INSTALL_DIR}/lib${FMK_NAME}.a\"\n\nopen \"${INSTALL_DIR}\"\n\n";
